            justify-content: center;
            align-items: center;
            color: #5d5d5d;
         }
         .linkedin {
            grid-area: a;
         }
         .github {
            grid-area: b;
         }
         .email {
            grid-area: c;
         }
         .contactCircle {
            background-color: black;
            border-radius: 100% 100% 100% 100%;
            width: 110px;
            height: 110px;
            display: flex;
            justify-content: center;
            align-items: center;
            border: 3px solid $mainBlue;
            margin-bottom: 7%;
            z-index: 2;
         }
      }
   }
}

.footer {
   background: $mainBlue;
   color: black;
   display: flex;
   letter-spacing: 1.5px;
   flex-direction: column;
   align-items: center;
   .footerContact {
      background: black;
      width: 60%;
      border-radius: 20px;
      display: flex;
      align-items: center;
      justify-content: space-evenly;
      padding: 40px;
      transform: translateY(-50%);
      color: white;
      h6 {
         width: 20%;
      }
      .chatButton {
         font-size: 1.6rem;
         background-color: black;
         color: white;
         padding: 20px;
         text-shadow: none;
         border-color: $mainBlue;
         border-style: solid;
         border-radius: 30px;
         cursor: pointer;
         outline: none;
      }
      a:hover .chatButton {
         background-color: $mainBlue;
         color: black;
      }
   }
   .footerBlurb {
      width: 25%;
      padding: 20px;
      font-family: $styleFont;
      margin-bottom: 1%;
   }
   p {
      font-size: 1.4rem;
      padding: 20px;
   }
}

// ! Media Queries ! //
@media only screen and (max-width: 600px) {
   h6 {
      font-size: 1rem;
   }
   h1 {
      font-size: 500%;
   }
   #landing {
      .navBar {
         width: 100vw;
         .navButtons {
            width: 100%;
            .skillsHeadButton {
               display: none;
            }
            ul {
               display: grid;
               grid-auto-flow: column;
            }
            li {
               display: inline-block;
            }
            a {
               margin: 0;
            }
         }
         .navName {
            display: none;
         }
      }
   }
   .content {
      width: 100vw;
      #about {
         margin: auto;
         margin-top: 20%;
         .bio {
            width: 100vw;
            flex-direction: column;
            img {
               width: 80%;
               height: 110%;
               margin: auto;
               padding-top: 5%;
               padding-bottom: 10%;
            }
            p {
               width: 80vw;
               margin: auto;
               text-align: center;
            }
         }
      }
      #experience {
         margin: auto;
         margin-top: 20%;
         .projectGroup {
            grid-template-areas:
            "d"
            "b"
            "c"
            "a";
            width: 90vw;
            margin: auto;
         }
      }
      #contact {
         margin-top: 20%;
         .contactGroup {
            grid-template-areas:
            "a"
            "b"
            "c";
            grid-template-columns: 0;
            .contactBox {
               margin-top: 25px;
            }
            .contactCircle {
               margin-bottom: 10px;
            }
            h6 {                      
               font-size: 1.6rem;
            }
         }
      }
      #skills {
         display: none;
      }
   }
   .footer {
      margin-top: 50%;
      background: black;
      color: white;
      .footerContact {
         width: 100%;
         border-radius: 0;
         flex-direction: column;
         transform: translateY(10%);
         h6 {
            width: 75%;
            margin: 6% 0;
         }
      }
      .footerBlurb {
         width: 90%;
         padding: 50px 0;
      }
   }   
}

